apiVersion: v1
kind: ConfigMap
metadata:
  name: jenkins-config
  namespace: jenkins
data:
  add_conf.sh: |-
    #!/bin/sh
    if [ ! -f /var/jenkins_home/config.xml ]; then
      cp -f /var/jenkins_config/config.xml /var/jenkins_home/config.xml 
    fi
    if [ ! -f /var/jenkins_home/credentials.xml ]; then
      cp -f /var/jenkins_config/credentials.xml /var/jenkins_home/credentials.xml
    fi
    if [ ! -f /var/jenkins_home/locale.xml ]; then
      cp -f /var/jenkins_config/locale.xml /var/jenkins_home/locale.xml
    fi
    cp -f /var/jenkins_config/org.codefirst.SimpleThemeDecorator.xml /var/jenkins_home/org.codefirst.SimpleThemeDecorator.xml
  config.xml: |-
    <?xml version='1.1' encoding='UTF-8'?>
    <hudson>
      <disabledAdministrativeMonitors/>
      <version>2.190.1</version>
      <installStateName>RUNNING</installStateName>
      <numExecutors>10</numExecutors>
      <mode>NORMAL</mode>
      <useSecurity>true</useSecurity>
      <authorizationStrategy class="hudson.security.AuthorizationStrategy$Unsecured"/>
      <securityRealm class="hudson.security.SecurityRealm$None"/>
      <disableRememberMe>false</disableRememberMe>
      <projectNamingStrategy class="jenkins.model.ProjectNamingStrategy$DefaultProjectNamingStrategy"/>
      <workspaceDir>${JENKINS_HOME}/workspace/${ITEM_FULL_NAME}</workspaceDir>
      <buildsDir>${ITEM_ROOTDIR}/builds</buildsDir>
      <jdks/>
      <viewsTabBar class="hudson.views.DefaultViewsTabBar"/>
      <myViewsTabBar class="hudson.views.DefaultMyViewsTabBar"/>
      <clouds>
        <org.csanchez.jenkins.plugins.kubernetes.KubernetesCloud plugin="kubernetes@1.20.1">
          <name>cluster</name>
          <defaultsProviderTemplate></defaultsProviderTemplate>
          <templates>
            <org.csanchez.jenkins.plugins.kubernetes.PodTemplate>
              <inheritFrom></inheritFrom>
              <name>jenkins-slave-dind</name>
              <namespace>jenkins</namespace>
              <privileged>false</privileged>
              <capOnlyOnAlivePods>false</capOnlyOnAlivePods>
              <alwaysPullImage>false</alwaysPullImage>
