                  <alwaysPullImage>false</alwaysPullImage>
                  <workingDir>/var/jenkins_home</workingDir>
                  <command></command>
                  <args></args>
                  <ttyEnabled>true</ttyEnabled>
                  <resourceRequestCpu></resourceRequestCpu>
                  <resourceRequestMemory></resourceRequestMemory>
                  <resourceLimitCpu></resourceLimitCpu>
                  <resourceLimitMemory></resourceLimitMemory>
                  <envVars/>
                  <ports/>
                  <livenessProbe>
                    <execArgs></execArgs>
                    <timeoutSeconds>0</timeoutSeconds>
                    <initialDelaySeconds>0</initialDelaySeconds>
                    <failureThreshold>0</failureThreshold>
                    <periodSeconds>0</periodSeconds>
                    <successThreshold>0</successThreshold>
                  </livenessProbe>
                </org.csanchez.jenkins.plugins.kubernetes.ContainerTemplate>
              </containers>
              <envVars/>
              <annotations/>
              <imagePullSecrets/>
              <nodeProperties/>
              <yamlMergeStrategy class="org.csanchez.jenkins.plugins.kubernetes.pod.yaml.Overrides"/>
              <showRawYaml>true</showRawYaml>
              <podRetention class="org.csanchez.jenkins.plugins.kubernetes.pod.retention.Default"/>
            </org.csanchez.jenkins.plugins.kubernetes.PodTemplate>
            <org.csanchez.jenkins.plugins.kubernetes.PodTemplate>
              <inheritFrom></inheritFrom>
              <name>jenkins-slave-nodejs</name>
              <namespace>jenkins</namespace>
              <privileged>false</privileged>
              <capOnlyOnAlivePods>false</capOnlyOnAlivePods>
              <alwaysPullImage>false</alwaysPullImage>
              <instanceCap>2147483647</instanceCap>
              <slaveConnectTimeout>100</slaveConnectTimeout>
              <idleMinutes>0</idleMinutes>
              <activeDeadlineSeconds>0</activeDeadlineSeconds>
              <label>jenkins-jnlp-nodejs</label>
              <nodeSelector></nodeSelector>
              <nodeUsageMode>EXCLUSIVE</nodeUsageMode>
              <workspaceVolume class="org.csanchez.jenkins.plugins.kubernetes.volumes.workspace.EmptyDirWorkspaceVolume">
                <memory>false</memory>
              </workspaceVolume>
              <volumes/>
              <containers>
                <org.csanchez.jenkins.plugins.kubernetes.ContainerTemplate>
                  <name>jenkins</name>
                  <image>gsmlg/jenkins-slave-jnlp-nodejs</image>
                  <privileged>false</privileged>
                  <alwaysPullImage>true</alwaysPullImage>
                  <workingDir>/home/jenkins/agent</workingDir>
                  <command></command>
                  <args></args>
                  <ttyEnabled>true</ttyEnabled>
                  <resourceRequestCpu></resourceRequestCpu>
                  <resourceRequestMemory></resourceRequestMemory>
                  <resourceLimitCpu></resourceLimitCpu>
                  <resourceLimitMemory></resourceLimitMemory>
                  <envVars/>
                  <ports/>
                  <livenessProbe>
                    <execArgs></execArgs>
                    <timeoutSeconds>0</timeoutSeconds>
                    <initialDelaySeconds>0</initialDelaySeconds>
                    <failureThreshold>0</failureThreshold>
                    <periodSeconds>0</periodSeconds>
                    <successThreshold>0</successThreshold>
                  </livenessProbe>
                </org.csanchez.jenkins.plugins.kubernetes.ContainerTemplate>
              </containers>
              <envVars/>
              <annotations/>
              <imagePullSecrets/>
              <nodeProperties/>
              <yamlMergeStrategy class="org.csanchez.jenkins.plugins.kubernetes.pod.yaml.Overrides"/>
              <showRawYaml>true</showRawYaml>
              <podRetention class="org.csanchez.jenkins.plugins.kubernetes.pod.retention.Default"/>
            </org.csanchez.jenkins.plugins.kubernetes.PodTemplate>
          </templates>
          <serverUrl></serverUrl>
          <skipTlsVerify>true</skipTlsVerify>
          <addMasterProxyEnvVars>false</addMasterProxyEnvVars>
          <capOnlyOnAlivePods>false</capOnlyOnAlivePods>
          <namespace>jenkins</namespace>
          <jenkinsUrl>jenkins.jenkins.svc</jenkinsUrl>
          <jenkinsTunnel>jenkins.jenkins.svc:50000</jenkinsTunnel>
          <credentialsId>6c12f304-9aad-4fbb-81f3-91c4c02faa88</credentialsId>
          <containerCap>10</containerCap>
          <retentionTimeout>5</retentionTimeout>
          <connectTimeout>5</connectTimeout>
          <readTimeout>15</readTimeout>
          <podLabels>
            <org.csanchez.jenkins.plugins.kubernetes.PodLabel>
              <key>jenkins</key>
              <value>slave</value>
            </org.csanchez.jenkins.plugins.kubernetes.PodLabel>
          </podLabels>
          <usageRestricted>false</usageRestricted>
          <maxRequestsPerHost>32</maxRequestsPerHost>
          <waitForPodSec>600</waitForPodSec>
          <podRetention class="org.csanchez.jenkins.plugins.kubernetes.pod.retention.Never"/>
        </org.csanchez.jenkins.plugins.kubernetes.KubernetesCloud>
      </clouds>
      <quietPeriod>5</quietPeriod>
      <scmCheckoutRetryCount>0</scmCheckoutRetryCount>
      <views>
        <hudson.model.AllView>
          <owner class="hudson" reference="../../.."/>
          <name>all</name>
          <filterExecutors>false</filterExecutors>
          <filterQueue>false</filterQueue>
          <properties class="hudson.model.View$PropertyList"/>
        </hudson.model.AllView>
      </views>
      <primaryView>all</primaryView>
      <slaveAgentPort>50000</slaveAgentPort>
      <label></label>
      <nodeProperties/>
      <globalNodeProperties/>
    </hudson>
